import React from 'react';
import './Footer.css';

function Company_Footer() {
    return (
        <div className='company_footer-container'>
            <section className='footer-subscription'>
                <p className='footer-subscription-heading'>
                    All Rights Reserved By The Varad Farm House, Kerli, Amba.
        </p>


            </section>
        </div>
    );
}

export default Company_Footer;
